<script>
export default {
  name: 'App',
  data () {
      return {
          api_key: '51ea9ae87e1e6e61855dd280d136f933',
          url_base: "https://api.openweathermap.org/data/2.5/",
          query: '',
          weather: {}
      }
  },
  computed: {
      computedClasses () {
          let classes = 'default';
          if( typeof( this.weather.main ) != 'undefined' ) {
              // temp
              classes = this.weather.main.temp > 72 ? 'warm' : 'cool';
              // clouds
              classes += this.weather.weather[0].main == "Clouds" ? ' cloudy' : '';
              // rain
              classes += this.weather.weather[0].main == "Rain" ? ' rain' : '';
              // lightning
              classes += this.weather.weather[0].main == "Thunderstorm" ? ' lightning' : '';
              // snow
              classes += this.weather.weather[0].main == "Snow" ? ' snow' : '';
          }
          return classes;
      }
  },
  methods: {
      fetchWeather () {
          fetch(`${this.url_base}weather?q=${this.query}&units=imperial&APPID=${this.api_key}`)
          .then(res => {
              return res.json();
          }).then(this.setResults);
      },
      setResults (results) {
          this.weather = results;
      },
      dateBuilder () {
          let d = new Date();
          let months = ["January","February","March","April","May","June","July","August","September","October","November","December"];
          let days = ["Sunday","Monday","Tuesday","Wednesday","Thursday","Friday","Saturday"];

          let day = days[d.getDay()];
          let date = d.getDate();
          let month = months[d.getMonth()];
          let year = d.getFullYear();

          return `${day} ${date} ${month} ${year}`;
      }
  }
}
</script>

